import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';

import { appSettings } from '../../core/CONSTANTS';
import { AuthInterface } from '../interfaces/auth.interface';
import { UserDataInterface } from '../interfaces/user-data.interface';

@Injectable()
export class AuthApiService {
  private apiUrl = appSettings.apiUrl;

  constructor(
    private http: HttpClient,
  ) {}

  public register(data: AuthInterface): Observable<void> {
    return this.http.post<void>(`${this.apiUrl}/auth/doctor/register`, data);
  }

  public login(data: AuthInterface): Observable<UserDataInterface> {
    const authData: AuthInterface = {
      name: data.name,
      password: data.password,
    };
    return this.http.post<UserDataInterface>(`${this.apiUrl}/auth/doctor/login`, authData);
  }
}

import { Injectable } from '@angular/core';
import { Router } from '@angular/router';

import { SessionInfoService } from './session-info.service';
import { UserDataInterface, UserInterface } from '../interfaces/user-data.interface';

@Injectable()
export class AuthService {
  constructor(
    private sessionInfo: SessionInfoService,
    private router: Router,
  ) {}

  public login(jwtToken: string, userData: UserInterface): void {
    const user: UserDataInterface = {
      token: jwtToken,
      user: userData,
    };
    this.sessionInfo.setUserData(user);
    this.router.navigate(['main']);
  }

  public isLogin(): boolean {
    const token = this.sessionInfo.getUserData();

    if (token) {
      return true;
    }
    return false;
  }

  public logout(): void {
    this.sessionInfo.removeUserData();
  }
}

